import { useState } from 'react';
import styled from '@emotion/styled';
import GoodsItem from '@components/GoodsItem/GoodsItem';
import Button, { ButtonProps } from '@components/Button/Button'; // ButtonProps Í∞ÄÏ†∏Ïò§Í∏∞

interface StyledButtonProps extends ButtonProps {
  active?: boolean;
}

const GiftRanking = () => {
  const [filter, setFilter] = useState('all');
  const [subFilter, setSubFilter] = useState('Î∞õÍ≥† Ïã∂Ïñ¥Ìïú');
  const [showMore] = useState(false);
  const GoodsImageLink = "https://st.kakaocdn.net/product/gift/product/20231030175450_53e90ee9708f45ffa45b3f7b4bc01c7c.jpg";

  const items = [
    { id: 1, rank: 1, name: 'BBQ ÏñëÎÖêÏπòÌÇ®+ÌÅ¨Î¶ºÏπòÏ¶àÎ≥º+ÏΩúÎùº1.25L', price: 29000, image: GoodsImageLink },
    { id: 2, rank: 2, name: 'BBQ ÏñëÎÖêÏπòÌÇ®+ÌÅ¨Î¶ºÏπòÏ¶àÎ≥º+ÏΩúÎùº1.25L', price: 29000, image: GoodsImageLink },
    { id: 3, rank: 3, name: 'BBQ ÏñëÎÖêÏπòÌÇ®+ÌÅ¨Î¶ºÏπòÏ¶àÎ≥º+ÏΩúÎùº1.25L', price: 29000, image: GoodsImageLink },
    { id: 4, rank: 4, name: 'BBQ ÏñëÎÖêÏπòÌÇ®+ÌÅ¨Î¶ºÏπòÏ¶àÎ≥º+ÏΩúÎùº1.25L', price: 29000, image: GoodsImageLink },
    { id: 5, rank: 5, name: 'BBQ ÏñëÎÖêÏπòÌÇ®+ÌÅ¨Î¶ºÏπòÏ¶àÎ≥º+ÏΩúÎùº1.25L', price: 29000, image: GoodsImageLink },
    { id: 6, rank: 6, name: 'BBQ ÏñëÎÖêÏπòÌÇ®+ÌÅ¨Î¶ºÏπòÏ¶àÎ≥º+ÏΩúÎùº1.25L', price: 29000, image: GoodsImageLink },
  ];

  const displayedItems = showMore ? items : items.slice(0, 6);

  return (
    <RankingContainer>
      <Title>Ïã§ÏãúÍ∞Ñ Í∏âÏÉÅÏäπ ÏÑ†Î¨ºÎû≠ÌÇπ</Title>
      <FilterContainer>
        <FilterButtonWrapper>
          <StyledButton onClick={() => setFilter('all')} active={filter === 'all'}>
            <FilterIcon>ALL</FilterIcon>
          </StyledButton>
          <FilterText active={filter === 'all'}>Ï†ÑÏ≤¥</FilterText>
        </FilterButtonWrapper>
        <FilterButtonWrapper>
          <StyledButton onClick={() => setFilter('female')} active={filter === 'female'}>
            <FilterIcon>üë©</FilterIcon>
          </StyledButton>
          <FilterText active={filter === 'female'}>Ïó¨ÏÑ±Ïù¥</FilterText>
        </FilterButtonWrapper>
        <FilterButtonWrapper>
          <StyledButton onClick={() => setFilter('male')} active={filter === 'male'}>
            <FilterIcon>üë®</FilterIcon>
          </StyledButton>
          <FilterText active={filter === 'male'}>ÎÇ®ÏÑ±Ïù¥</FilterText>
        </FilterButtonWrapper>
        <FilterButtonWrapper>
          <StyledButton onClick={() => setFilter('teen')} active={filter === 'teen'}>
            <FilterIcon>üßë</FilterIcon>
          </StyledButton>
          <FilterText active={filter === 'teen'}>Ï≤≠ÏÜåÎÖÑÏù¥</FilterText>
        </FilterButtonWrapper>
      </FilterContainer>
      <SubFilterContainer>
        <SubFilterButton onClick={() => setSubFilter('Î∞õÍ≥† Ïã∂Ïñ¥Ìïú')} active={subFilter === 'Î∞õÍ≥† Ïã∂Ïñ¥Ìïú'}>Î∞õÍ≥† Ïã∂Ïñ¥Ìïú</SubFilterButton>
        <SubFilterButton onClick={() => setSubFilter('ÎßéÏù¥ ÏÑ†Î¨ºÌïú')} active={subFilter === 'ÎßéÏù¥ ÏÑ†Î¨ºÌïú'}>ÎßéÏù¥ ÏÑ†Î¨ºÌïú</SubFilterButton>
        <SubFilterButton onClick={() => setSubFilter('ÏúÑÏãúÎ°ú Î∞õÏùÄ')} active={subFilter === 'ÏúÑÏãúÎ°ú Î∞õÏùÄ'}>ÏúÑÏãúÎ°ú Î∞õÏùÄ</SubFilterButton>
      </SubFilterContainer>
      <ItemsContainer>
        {displayedItems.map(item => (
          <GoodsItem
            key={item.id}
            title={item.name}
            imageSrc={item.image}
            amount={item.price}
            rankingIndex={item.rank}
          />
        ))}
      </ItemsContainer>
    </RankingContainer>
  );
};

const RankingContainer = styled.div`
  padding: 20px;
  background-color: #fff;
  border-radius: 8px;
`;

const Title = styled.h2`
  font-size: 18px;
  font-weight: bold;
  margin-bottom: 20px;
`;

const FilterContainer = styled.div`
  display: flex;
  gap: 10px;
  margin-bottom: 20px;
`;

const FilterButtonWrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const StyledButton = styled(Button)<StyledButtonProps>`
  display: flex;
  align-items: center;
  justify-content: center;
  width: 80px;
  height: 80px;
  border: none;
  border-radius: 20px;
  background-color: ${({ active }) => (active ? '#007aff' : '#e0e0e0')};
  color: ${({ active }) => (active ? '#fff' : '#333')};
  cursor: pointer;
`;

const FilterIcon = styled.span`
  font-size: 24px;
`;

const FilterText = styled.span<{ active: boolean }>`
  font-size: 14px;
  margin-top: 5px;
  color: ${({ active }) => (active ? '#007aff' : '#333')}; // ÌÖçÏä§Ìä∏ ÏÉâÏÉÅ Î≥ÄÍ≤Ω
`;

const SubFilterContainer = styled.div`
  display: flex;
  gap: 10px;
  margin-bottom: 20px;
  background-color: #e0f7fa; // ÌïòÎäòÏÉâ Î∞∞Í≤Ω
  padding: 10px;
  border-radius: 10px;
`;

const SubFilterButton = styled(Button)<StyledButtonProps>`
  background-color: transparent; // Î∞∞Í≤ΩÏÉâÏùÑ Ìà¨Î™ÖÏúºÎ°ú Î≥ÄÍ≤Ω
  color: ${({ active }) => (active ? '#007aff' : '#333')};
  cursor: pointer;
`;

const ItemsContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: 20px;
`;

export default GiftRanking;
